import React from 'react';
import './WeeklyChart.css'; // 주간 인기 차트 전용 스타일 파일

interface WeeklyChartProps {
    top10WeeklySongs?: any[]; // 선택적 속성으로 변경
}

const WeeklyChart: React.FC<WeeklyChartProps> = ({ top10WeeklySongs = [] }) => {
    return (
        <div className="weekly-chart">
            <h3>주간 인기 차트</h3>
            <ul className="chart-list">
                {top10WeeklySongs.length > 0 ? (
                    top10WeeklySongs.map((song: any, index: number) => (
                        <li key={song.id} className="chart-item">
                            <h4>{index + 1}. {song.title}</h4>
                            <span>{song.artist}</span>
                        </li>
                    ))
                ) : (
                    <p>주간 인기 차트가 없습니다.</p>
                )}
            </ul>
            <div className="chart-footer">월요일 00시 기준</div>
        </div>
    );
};

export default WeeklyChart;
